import React from "react";
import "./tutorialpage.css"; // Make sure to create this CSS file
import { useNavigate } from "react-router-dom";

const TutorialPage = () => {
  const navigate = useNavigate();

  const handleSignUpClick = () => {
    navigate("/signup"); // Must match the path in your Router
  };

  return (
    <div className="tutorial-container">
      <div className="tutorial-box">
        <h1>Welcome to Study Buddy!</h1>
        <p>
          Study Buddy is a platform designed to connect Delaware State University
          students with compatible study partners. Here's how to get started:
        </p>

        <ol>
          <li>
            <strong>Create an Account:</strong> Sign up using your DSU email to access the platform.
          </li>
          <li>
            <strong>Build Your Profile:</strong> Add your courses, interests, and study preferences.
          </li>
          <li>
            <strong>Find Matches:</strong> Filter or browse study buddy recommendations.
          </li>
          <li>
            <strong>Send Requests:</strong> Request to connect and start a study session.
          </li>
          <li>
            <strong>Start Studying:</strong> Chat, schedule sessions, and succeed together!
          </li>
        </ol>

        <p>Ready to get started?</p>
        <button className="signup-button" onClick={handleSignUpClick}>
          Create Your Account
        </button>
      </div>
    </div>
  );
};

export default TutorialPage;
